import React from 'react';
import { Link, useParams } from 'react-router-dom';
import ClipboardJS from 'clipboard'; 
import './ElementsPage.css'
import Sidebar from './Sidebar';
import ElementContainer from '../../components/element-container';
import elementsData from '../../components/elementsData';

const ElementPage = () => {
  const { id } = useParams()
  const data = elementsData[id]

  if (!data) {
    throw new Error('Not defined')
  }

  const cssCode = data.css;

  const classRegex = /\.([\w-]+)/g;
  const propertyRegex = /(\w+)\s*:\s*([^;]+)/g;

  const styledCss = cssCode
    .replace(classRegex, '<span style="color: orange;">.$1</span>')
    .replace(propertyRegex, '<span style="color: blue;">$1</span>:<span style="color: blue;">$2</span>');

  const clipboardHTML = new ClipboardJS('#copy-html', {
    text: function () {
      return data.html;
    },
  });

  const clipboardCSS = new ClipboardJS('#copy-css', {
    text: function () {
      return data.css;
    },
  });

  React.useEffect(() => {
    return () => {
      clipboardHTML.destroy();
      clipboardCSS.destroy();
    };
  }, [clipboardHTML, clipboardCSS]);


  return (
    <div className="ElementsPage--wrapper">
            <div className="wrapper2 elementById-wrapper">
                <Sidebar/>
                <main className='elements-block--wrapper'>
                    <div className="elements-block--navbar">
                        <div className="elements-block--navbar_buttons">
                            <div className="HomePage--button elements-block--navbar_button">
                                <Link to="/ElementsPage">
                                    <button>
                                        Go Back
                                    </button>
                                </Link>
                            </div> 
                            <div className="AllElements--dropdown">
                                <Link to="/MainPage">
                                    <button>
                                        All Elements dropdown
                                    </button>
                                </Link>
                            </div>
                        </div>
                        <div className="search elementById-search">
                          <input type="search" placeholder='Search for UI elements'/>
                          <div className="search--button elementById-search--button">
                            <img src="/assets/png/search-white.png" alt="search"/>
                            <button>Search</button>
                          </div>
                        </div>
                    </div>
                    <div className="element--block">
                        {/* <h2>{data.metadata.name}</h2> */}
                      <div className="elements-block elementById-block">
                        <div dangerouslySetInnerHTML={{ __html: data.html }}></div>
                        <style>{data.css}</style>
                      </div>
                      <div className="elementByID-code" style={{maxWidth:'54rem', overflowX:'auto', overflowWrap: 'break-word', textAlign: 'left', padding: '1rem'}}>
                      <div className="code-lines" style={{fontSize: '1.6rem'}}>
                      {data.css.split('\n').map((line, index) => {
                      const classMatch = line.match(/^\s*\.([^\s{]+)\s*{/); // Extract class name from CSS rule
                      const idMatch = line.match(/^\s*#([^\s{]+)\s*{/); // Extract ID from CSS rule
                      if (classMatch && classMatch[1]) {
                        const className = classMatch[1];
                        return (
                          <div key={index}>
                            <span style={{ color: '#E4C104' }}>.{className}</span>
                            <span style={{ color: '#90CAE8' }}>{line.replace(`.${className}`, '')}</span>
                          </div>
                        );
                      } else if (idMatch && idMatch[1]) {
                        const idName = idMatch[1];
                        return (
                          <div key={index}>
                            <span style={{ color: 'purple' }}>#{idName}</span>
                            <span style={{ color: 'green' }}>{line.replace(`#${idName}`, '')}</span>
                          </div>
                        );
                      }
                          return (
                            <div key={index}>
                              <span style={{ color: '#90CAE8' }}>{line}</span>
                            </div>
                          );
                        })}
                      </div>
                      </div>
                      {/* <button id="copy-html" className="copy-button">
                        Copy HTML
                      </button>
                      <button id="copy-css" className="copy-button">
                        Copy CSS
                      </button> */}
                    </div>
                </main>
            </div>
       </div>
  );
};

export default ElementPage;
